import React from 'react';
import ReactDOM from 'react-dom';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import FilledInput from '@material-ui/core/FilledInput';
import FormControl from '@material-ui/core/FormControl';
import FormHelperText from '@material-ui/core/FormHelperText';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import TextField from '@material-ui/core/TextField';
import InputAdornment from '@material-ui/core/InputAdornment';
import MenuItem from '@material-ui/core/MenuItem';
import Button from '@material-ui/core/Button';


const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  formControl: {
    margin: theme.spacing.unit,
  },
});

const ranges = [
  {
    value: 'Y',
    label: 'Yes',
  },
  {
    value: 'N',
    label: 'No',
  },

];

const time = [

    {
    value: 'AM',
    label: 'AM',
  },
  {
    value: 'PM',
    label: 'PM',
  },

]


class ComposedTextField extends React.Component {



  render() {
    const { classes, handleEditChange, highway: { Name1, VehicleType, num, transponder } } = this.props;

    return (
      <div className={styles.formControl}>

          Highway Information:

          <br/>

        <FormControl className={classes.formControl}>
          <InputLabel htmlFor="component-simple">Name</InputLabel>
          <Input id="component-simple" value={Name1} onChange={handleEditChange("Name1")} />
        </FormControl>
        <FormControl className={classes.formControl} aria-describedby="component-helper-text">
          <InputLabel htmlFor="component-helper">Type of Vehicle</InputLabel>
          <Input id="component-helper" value={VehicleType} onChange={handleEditChange("VehicleType")} />
          <FormHelperText id="component-helper-text">(L - Light, H - Heavy, M - Multiple Heavy)</FormHelperText>
        </FormControl>
            <br/>
             <TextField


        id="outlined-number"
        label="Km"
        type="number"
        InputLabelProps={{
          shrink: true,
        }}
        margin="normal"
        value={num}
        onChange={handleEditChange("num")}

            />
          <br/>

          <TextField
        select
        label="Transponder"
        value={transponder}
        onChange={handleEditChange("transponder")}
        InputProps={{
          startAdornment: <InputAdornment position="start"></InputAdornment>,
        }}
      >
        {ranges.map(option => (
          <MenuItem key={option.value} value={option.value}>
            {option.label}
          </MenuItem>
        ))}
      </TextField>
        <br/>

          <div style={{flex: 1, marginTop:30}}>

            Time of Day:

                <br/>
                <br/>

               <TextField
        select
        label="AM/PM"
        value={transponder}
        onChange={handleEditChange("transponder")}
        InputProps={{
          startAdornment: <InputAdornment position="start"></InputAdornment>,
        }}
      >
        {time.map(option => (
          <MenuItem key={option.value} value={option.value}>
            {option.label}
          </MenuItem>
        ))}
      </TextField>

              <br/>

              <TextField

        id="outlined-number"
        className={{flexWrap:"flex"}}
        label="Km"
        type="number"
        InputLabelProps={{
          shrink: true,
        }}
        margin="normal"
        value={num}
        onChange={handleEditChange("num")}

            />


          </div>
            <div style={{flex: 1, marginTop:30, marginRight:45}}>
          <Button variant="contained" color="primary" className={classes.button}>
        Primary
      </Button>
            </div>

      </div>


    );
  }
}

ComposedTextField.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ComposedTextField);
